    function hourIncre(s, h) {
        var date = new Date(s);
        return getLocalTime(date.setHours(date.getHours() + h));
    }
    function getLocalTime(ns) {

        var d = new Date(ns);
        var year = d.getFullYear();
        var month = (d.getMonth() + 1) + "";
        if (month.length == 1) {
            month = "0" + month;
        }

        var day = (d.getDate()) + "";
        if (day.length == 1) {
            day = "0" + day;
        }

        var hour = (d.getHours()) + "";
        if (hour.length == 1) {
            hour = "0" + hour;
        }

        var minutes = (d.getMinutes()) + "";
        if (minutes.length == 1) {
            minutes = "0" + minutes;
        }

        var sec = (d.getSeconds()) + "";
        if (sec.length == 1) {
            sec = "0" + sec;
        }
        return year + "-" + month + "-" + day + " " + hour + ":" + minutes + ":" + sec;
    }

    function getColorByLevel(level) {
        if (level == "1") {
            return "#00E500";
        } else if (level == "2") {
            return "#FFFF00";
        } else if (level == "3") {
            return "#FF7E00";
        } else if (level == "4") {
            return "#FF0000";
        } else if (level == "5") {
            return "#99004C";
        } else if (level == "6") {
            return "#7E0023";
        } else {
            return "#00E500";
        }
    }
